  render() {
    return (
        <div className="App" style={{backgroundImage: "url(" + Background + ")", backgroundSize: 'contain',backgroundRepeat: 'no-repeat', backgroundPosition:'center', width: '100'}}>
          <div>
            <h1> Welcome</h1>
          </div>
        </div>
       
    );
  }
}

